// Import the React and ReactDOM libraries
import React from 'react';
import ReactDOM from 'react-dom';
import headerImg from '.img/unnamed.jpg'

// Create a react component
const App = () => {


  return (
    <div style={{
      backgroundImage: 'url(${headerImg})',
      position: 'absolute',
      width: '100vw',
      height: '100vh'
      //backgroundImage: "url(${headerImg})"backgroundColor: "#ffe063"
    }}>

      <h2 style={{
        textAlign: "center", color: "#baa7d9"
      }}>Hello, I'm  Kulikova Dariia</h2>
      <a href="https://www.linkedin.com/in/dariia-kulikova-6b48ab172">
        <img style={{
          width: "30px",
          margin: "30px auto"
        }}
          src="Linkedin.png" />
        LinkedIn
      </a>

      <a href="https://github.com/dariiakulik">
        <img style={{
          width: "30px",
          margin: "30px auto"
        }}
          src="github.png" />
        Github
      </a>

      <a href="https://resume.io/r/zeT2qZVHx">
        <img style={{
          width: "30px",
          margin: "30px auto"
        }}
          src="cv.jpeg" />
       CV
      </a>


    </div >
  );
};

// Take the react component and show it on the screen
ReactDOM.render(<App />, document.querySelector('#root'));
